var jsfeat = require('jsfeat');
const Jimp = require('jimp');
const smartcrop = require('smartcrop');

async function onRuntimeInitialized()
{
function getBase64Img() {
    return "";
}
const buffer = Buffer.from(getBase64Img(), "base64");
var imageData=await Jimp.read('./normal.jpg');
//const imageData=smartcrop.crop(imageData1, { width: 100, height: 100 });
const cols=imageData.bitmap.width;
const rows=imageData.bitmap.height;
var dataBuffer = new jsfeat.data_t(cols * rows, imageData.bitmap.data.buffer);
var mat = new jsfeat.matrix_t(cols, rows, jsfeat.U8_t | jsfeat.C4_t, dataBuffer);


var gray = new jsfeat.matrix_t(mat.cols, mat.rows, jsfeat.U8_t | jsfeat.C1_t);

jsfeat.imgproc.grayscale(mat.data, mat.cols, mat.rows, gray);

var threshold = 10;
jsfeat.fast_corners.set_threshold(threshold);
 
var corners = [], border = 3;
 
// you should use preallocated keypoint_t array
for(var i = 0; i < cols*rows;++i)
{
    corners[i] = new jsfeat.keypoint_t(0,0,0,0);
}
//console.log(corners)
var count = jsfeat.fast_corners.detect(gray, corners, border);
var non_null_corners = [];
for (var i = 0; i < count ; i++)
    {
        //console.log(corners[i].score);
        if(corners[i].score>80)
        {
        non_null_corners.push(corners[i]);
        } 
    }
console.log(non_null_corners);
for (var j = 0; j < non_null_corners.length ; j++)
{
var idx = (cols*non_null_corners[j].y + non_null_corners[j].x) << 2;
imageData.bitmap.data[idx] = 0;    // R
imageData.bitmap.data[idx+1] = 0;  // G
imageData.bitmap.data[idx+2] = 255;// B
imageData.bitmap.data[idx+3] = 255;// Alpha (transparency)
}
//console.log(gray);
imageData.rotate(90);
imageData.write('output2.jpg');
// perform detection
// returns the amount of detected corners
// var count = jsfeat.fast_corners.detect(img:matrix_t, corners:Array, border = 3);

}

onRuntimeInitialized();